import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Button from "react-bootstrap/Button";
import { useState, useEffect } from "react";
import { Routes, Route, Link, useNavigate } from "react-router-dom";
import Navbar from "./Navbar";
import HiddenBar from "./HiddenBar";
import CollectionAll from "./CollectionAll";
import Footer from "./Footer";
import { useTrail, animated } from "react-spring"; // react-spring의 useTrail, animated 추가

function App() {
  const [rainToggle, setRainToggle] = useState(false);

  useEffect(() => {
    // 비가 내리는 애니메이션 토글
    const interval = setInterval(() => {
      setRainToggle((prevState) => !prevState);
    }, 3000); // 3초마다 토글
    return () => clearInterval(interval);
  }, []);

  const numDrops = 10; // 빗방울 개수
  const trailProps = useTrail(numDrops, {
    from: { opacity: 0, y: -100 },
    to: { opacity: 1, y: 500 },
    config: { mass: 10, tension: 400, friction: 40, duration: 2000 },
    reset: true,
    reverse: rainToggle,
  });

  return (
    <div className="App">
      {/* 비가 내리는 애니메이션 */}
      <div className="rain-animation-container">
        {trailProps.map((props, index) => (
          <animated.div key={index} style={props} className="rain-drop" />
        ))}
      </div>

      <div className="space"></div>
      <Navbar />
      <HiddenBar />
      <Routes>
        <Route
          path="/"
          element={
            <div>
              <div className="image-container">
                <img
                  src="https://img.buzzfeed.com/buzzfeed-static/complex/images/Y19jcm9wLGhfMTA2Myx3XzE4OTAseF82MSx5XzUzNA==/n2cea88ufnetdahec8jf/air-jordan-1-high-lost-and-found-dz5485-612-5.jpg?output-format=jpg&output-quality=auto"
                  className="main-image"
                ></img>
                <div className="bottom-left">
                  <p className="main-image-title">DOBLUE</p>
                  <p className="main-image-description">
                    EXPLORE, RESTORE, ENCORE.{" "}
                  </p>
                </div>
              </div>

              <div className="doblue-info">
                <div className="image-container">
                  {" "}
                  <img src="https://i.ebayimg.com/images/g/Xe4AAOSwCJhjZ5SS/s-l1200.jpg" />
                  <p className="bottom-left doblue-info-description">DOBLUE</p>
                </div>
                <div className="image-container">
                  {" "}
                  <img src="https://i.ebayimg.com/images/g/Xe4AAOSwCJhjZ5SS/s-l1200.jpg" />
                  <p className="bottom-left doblue-info-description">BUY</p>
                </div>
                <div className="image-container">
                  {" "}
                  <img src="https://i.ebayimg.com/images/g/Xe4AAOSwCJhjZ5SS/s-l1200.jpg" />
                  <p className="bottom-left doblue-info-description">
                    SELL/TRADE
                  </p>
                </div>
              </div>
              <div className="main-page-description">
                <div className="main-page-description-text">
                  <h2>DOBLUE</h2>
                  <p>[dəbluː]</p>{" "}
                  <p>
                    DESCRIPTION DESCRIPTION DESCRIPTION DESCRIPTION DESCRIPTION
                    DESCRIPTION DESCRIPTION DESCRIPTION DESCRIPTION DESCRIPTION
                    DESCRIPTION DESCRIPTION DESCRIPTION DESCRIPTION DESCRIPTION
                    DESCRIPTION DESCRIPTION DESCRIPTION{" "}
                  </p>
                </div>
                <img
                  className="main-page-description-img"
                  src="logo512.png"
                ></img>
              </div>
              <Link to={"/collection/all"}>
                <Button variant="outline-info" className="more-button">
                  View All
                </Button>{" "}
              </Link>
            </div>
          }
        />
        <Route path="/cart" element={<div>cart</div>}></Route>
        <Route path="/collection/all" element={<CollectionAll />}></Route>
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
